pragma solidity ^0.4.23;

import "zeppelin-solidity/contracts/token/ERC20/ERC20.sol";
import "zeppelin-solidity/contracts/math/SafeMath.sol";

library TokenReceiverLib { 
    using SafeMath for uint256;

    struct Data {
        address tokenAddress;
        uint256 totalDepositedValue;
        mapping(address => uint256) deposits;
    }

    function unattributedTokenValue(Data storage self) public view returns (uint256 _value) { 
        ERC20 token = ERC20(self.tokenAddress);
        uint256 erc20balance = token.balanceOf(address(this));

        if(erc20balance <= 0) {
            return 0;
        }

        return erc20balance.sub(self.totalDepositedValue);
    }

    function attributeUnowned(Data storage self, address owner, uint256 _value) public returns (bool _success) { 
        require(_value > 0, "Attribution value must be non-zero");

        uint256 current = unattributedTokenValue(self);

        require(_value <= current, "Attribution of tokens must be less than the unattributed value assigned to this contract");
        require(_attribute(self, msg.sender, _value), "Token attribution must be successful");

        return true;
    }

    function depositHere(Data storage self, uint256 _value) public returns (bool _result) { 
        ERC20 token = ERC20(self.tokenAddress);

        require(token.balanceOf(msg.sender) >= _value, "Sender must have a token value greater than or equal to the deposit value.");
        require(token.transferFrom(msg.sender, address(this), _value), "Token transfer to contract must be successful.");

        require(_attribute(self, msg.sender, _value), "Token attribution must be successful");

        return true; 
    }

    function _attribute(Data storage self, address owner, uint256 _value) private returns (bool _result) { 
        self.deposits[owner] = self.deposits[owner].add(_value);
        self.totalDepositedValue = self.totalDepositedValue.add(_value);
        return true;
    }

    function withdrawTo(Data storage self, address _address, uint256 _value) public returns (bool _result) { 
        require(_address != address(0), "Destination address must be non zero.");
        require(self.deposits[_address] >= _value, "Destination address must have deposited atleast the withdrawl value.");

        ERC20 token = ERC20(self.tokenAddress);

        token.transfer(_address, _value);
        self.deposits[_address] = self.deposits[_address].sub(_value);
        self.totalDepositedValue = self.totalDepositedValue.sub(_value);

        return true; 
    }

    function checkERC20Contract(address _address) public view { 
        require(_address != address(0), "Token contract address must be non zero.");
        ERC20 token = ERC20(_address);

        // TODO - these are the only callable function that we can pass
        // no parameters into, we should get a runtime exception if this
        // fails, guarding against setting to invalid addresses.
        // EIP 881 will give a way for querying supported contracts
        require(token.totalSupply() > 0);
    }
}
